    <style>
        /* General Reset */
* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

/* Body Styles */
body {
    font-family: Arial, sans-serif;
    background-color: #f4f4f4;
    color: #333;
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
}

/* Container Styles */
.container {
    display: flex;
    flex-direction: column; /* Stacking elements vertically on smaller screens */
    justify-content: center;
    align-items: center;
    text-align: center;
    padding: 20px;
    background: white;
    border-radius: 10px;
    box-shadow: 0 4px 10px rgba(0, 0, 0, 0.1);
}

/* Text Content Styles */
.text-content {
    margin-bottom: 20px;
}

/* Image Content Styles */
.image-content img {
    max-width: 100%;
    height: auto;
}

/* Responsive Styles */
@media (min-width: 768px) {
    .container {
        flex-direction: row; /* Change to row on larger screens */
    }
    .text-content {
        margin-right: 20px; /* Add space between text and image */
        text-align: left; /* Align text to the left on wider screens */
    }
    .image-content {
        flex: 1; /* Allow image to take available space */
    }
}
    </style>
</head>
